INSERT INTO `book` (`BookID`, `CategoryID`, `AuthorName`, `BookTitle`, `PublishedDate`, `Image`, `Description`, `Price`) VALUES
(1, 2, 'Amy Poehler', 'Yes Please ', '2015-09-01', , 'Do you want to get to know the woman we first came to love on Comedy Central\'s Upright Citizens Brigade? Do you want to spend some time with the lady who made you howl with laughter on Saturday Night Live, and in movies like Baby Mama, Blades of Glory, and They Came Together? Do you find yourself daydreaming about hanging out with the actor behind the brilliant Leslie Knope on Parks and Recreation? Did you wish you were in the audience at the last two Golden Globes ceremonies, so you could bask in the hilarity of Amy\'s one-liners?', '120');
INSERT INTO `book` (`BookID`, `CategoryID`, `AuthorName`, `BookTitle`, `PublishedDate`, `Image`, `Description`, `Price`) VALUES
(2, 1, 'Andrea Simitch, Val Warke ', 'The language of Architecture', '2014-06-01', , 'DIVLearning a new discipline is similar to learning a new language; in order to master the foundation of architecture, you must first master the basic building blocks of its language  the definitions, function, and usage. Language of Architecture provides students and professional architects with the basic elements of architectural design, divided into twenty-six easy-to-comprehend chapters. This visual reference includes an introductory, historical view of the elements, as well as an overview of how these elements can and have been used across multiple design disciplines.', '90'),
(3, 3, 'David Ritz', 'Divided Soul: The Life Of Marvin Gaye', '1985-04-01', , 'The Life of Marvin Gaye: Divided Soul is the definitive biography of an enormously gifted and sensitive musician.\r\n\r\nDavid Ritz presents his uniquely candid and intimate account of the tumultuous life of the Prince of Soul music, Marvin Gaye.\r\n\r\nAssembling years of conversations and interviews from his life as a close friend and lyricist to the gifted Soul sensation, Ritz tells the Marvin Gaye story with fly-on-the-wall accuracy and detail. From his early years as an abused child in the slums of Washington DC, through his rise to the very peaks of the Motown phenomenon, his fall from grace and subsequent comeback, to his untimely death at the hands of his father, Marvin\'s story is the stuff of legends.\r\n\r\nThe cast of characters includes the Jacksons, Smokey Robinson, Diana Ross and countless other icons of the world of soul music.', '85'),
(4, 4, 'Modris Eksteins', 'Rites of Spring', '1989-01-02', , 'This award-winning cultural history reveals how the Great War changed humanity.\r\n \r\nThis sweeping volume probes the origins, the impact, and the aftermath of World War Ifrom the premiere of Igor Stravinskys ballet The Rite of Spring in 1913 to the death of Hitler in 1945. The Great War, as Modris Eksteins writes, was the psychological turning point . . . for modernism as a whole. The urge to create and the urge to destroy had changed places.\r\n \r\nIn this bold and fertile book (The Atlantic Monthly), Eksteins goes on to chart the seismic shifts in human consciousness brought about by this great cataclysm, through the lives and words of ordinary people, works of literature, and such events as Lindberghs transatlantic flight and the publication of the first modern bestseller, All Quiet on the Western Front. Rites of Spring is a rare and remarkable work, a cultural history that redefines the way we look at our pastand toward our future.', '70'),
(5, 5, 'Bram Stroker ', 'Dracula', '1987-05-26', , 'Dracula is an 1897 Gothic horror novel by Irish author Bram Stoker. It introduced the character of Count Dracula and established many conventions of subsequent vampire fantasy.', '65');

